import React, { useState } from "react";
import { Menu, Switch, Button, Col, Row } from "antd";
import { Link } from "react-router-dom";
import "./css/styles.css";
import Media from "react-media";
import {
  CalendarOutlined,
  AppstoreOutlined,
  SettingOutlined,
  HomeOutlined,
  LogoutOutlined,
  BulbOutlined
} from "@ant-design/icons";
import Avatar from "antd/lib/avatar/avatar";
const Index = (props) => {
  console.log(props.e);
  const [current, setCurrent] = useState("home");
  const [theme,setTheme]=useState('light');
  const handleClick = (e) => {
    setCurrent(e.key);
  };
  const toggleTheme=()=>{
      theme==='light'?setTheme('dark'):setTheme('light');
  }
  const { SubMenu } = Menu;

  return (
    <div>
      <Media
        query="(max-width: 599px)"
        render={() => (
          <Menu mode="horizontal">
            <Menu.Item key="1" icon={<HomeOutlined />}>
              Home
            </Menu.Item>
            <SubMenu key="sub1" icon={<AppstoreOutlined />} title="Infomations">
              <Menu.Item key="3">Employees</Menu.Item>
              <Menu.Item key="4">Department</Menu.Item>
            </SubMenu>
            <SubMenu key="sub2" icon={<CalendarOutlined />} title="Date">
              <Menu.Item key="7">Holidays</Menu.Item>
              <Menu.Item key="8">Leave</Menu.Item>
              <Menu.Item key="9">Attandance</Menu.Item>
            </SubMenu>
            <SubMenu key="sub2" icon={<SettingOutlined />} title="Settings">
              <Menu.Item key="7">Option 7</Menu.Item>
              <Menu.Item key="8">Log out</Menu.Item>
            </SubMenu>
          </Menu>
        )}
      />

      <Media
        query="(min-width: 599px)"
        render={() => (
          <Menu
            style={{ width: 256 }}
            defaultSelectedKeys={[`$`]}
            defaultOpenKeys={["sub1", "sub2","sub3"]}
            mode="inline"
            theme={theme}
          >
            <Menu.Item key="1" icon={<HomeOutlined />}>
              Home
            </Menu.Item>
            <SubMenu key="sub1" icon={<AppstoreOutlined />} title="Infomations">
              <Menu.Item key="3" style={{color:"blue"}} >Employees</Menu.Item>
              <Menu.Item key="4" style={{color:"blue"}}>Departments</Menu.Item>
            </SubMenu>
            <SubMenu key="sub2" icon={<CalendarOutlined />} title="Date">
              <Menu.Item key="7" style={{color:"blue"}}>Holidays</Menu.Item>
              <Menu.Item key="8" style={{color:"blue"}}>Leave</Menu.Item>
              <Menu.Item key="9" style={{color:"blue"}}>Attandance</Menu.Item>
            </SubMenu>
            <SubMenu key="sub3" icon={<SettingOutlined />} title="Settings">
              <Menu.Item key="10" icon={<BulbOutlined />} style={{color:"green"}}>
                <Switch onChange={toggleTheme}></Switch>
              </Menu.Item>
              <Menu.Item key="11" icon={<LogoutOutlined />} style={{color:"blue"}}>
               Log out
              </Menu.Item>
            </SubMenu>
          </Menu>
        )}
      />
    </div>
  );
};

export default Index;
